The &quot;Chris Cox Megamix&quot; is the second single from the limited edition of Britney Spears's album Greatest Hits: My Prerogative. The song was mixed by Chris Cox and was released during the fourth quarter of 2004 in the Philippines, Hong Kong and also as a preorder gift in Taiwan[citation needed]. The CD also included the Megamix music video and the full version of the Chris Cox Megamix. The video also received airplay in Australia and Europe to promote the album. For promotion, the music video of the megamix was included on the DualDisc edition of &quot;In the Zone&quot; 


